import React from 'react';

const Frpinv = () => {
  return (
    <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '20px' }}>
      <h1>FRP 투자 종합성과</h1>
      <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'flex-end' }}>
        <div style={{ borderBottom: '1px solid black', border: '1px solid maroon', padding: '10px' }}>닐자</div>
        <div style={{ borderBottom: '1px solid black', border: '1px solid maroon', padding: '10px' }}>FIL 가격</div>
      </div>
    </div>
  );
};

export default Frpinv;
